import React from "react";
function LeftSection({
  imageURL,
  titel,
  description,
  trydemoURL,
  lernmoreURL,
  playstoreURL,
  appstoreURL,
}) {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">
            <img src={imageURL} alt="product" className="img-fluid"/>

        </div>
        <div className="col-6">
            <h1 className="fs-3">{titel}</h1>
            <p className="fs-6">{description}</p>
            <a href={trydemoURL} className="btn btn-primary m-2">Try Demo</a>
            <a href={lernmoreURL} className="btn btn-secondary m-2">Learn More</a>
            <br></br>
            <a href={playstoreURL} className="m-2"><img src=" " alt="playstore"/></a>
            <a href={appstoreURL} className="m-2"><img src=" " alt="appstore"/></a>
        </div>
      </div>
    </div>
  );
}

export default LeftSection;
